import styled from 'styled-components';

// eslint-disable-next-line import/prefer-default-export
export const Container = styled.header`
    display: flex;
    justify-content: center;
    align-items: center;
`;
export const Cart = styled(link)`
display: flex;
align-items: center;
text
`;
